import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';
import Dashboard from './components/Dashboard';
import SignIn from './components/SignIn';
import SignUp from './components/SignUp';
import ProtectedRoute from './components/ProtectedRoute';
import AWSCredentials from './components/AWSCredentials';
import GCPCredentials from './components/GCPCredentials';
import GCPBillingPage from './components/GCPBillingPage'; // Import the new component
import AzureCredentials from './components/AzureCredentials';

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/signin" element={<SignIn />} />
        <Route path="/signup" element={<SignUp />} />
        <Route 
          path="/dashboard" 
          element={
            <ProtectedRoute>
              <Dashboard />
            </ProtectedRoute>
          } 
        />
        <Route 
          path="/aws-credentials" 
          element={
            <ProtectedRoute>
              <AWSCredentials />
            </ProtectedRoute>
          } 
        />
        <Route 
          path="/gcp-credentials" 
          element={
            <ProtectedRoute>
              <GCPCredentials />
            </ProtectedRoute>
          } 
        />
        <Route 
          path="/gcp-billing" 
          element={
            <ProtectedRoute>
              <GCPBillingPage />
            </ProtectedRoute>
          } 
        />
        <Route 
          path="/azure-credentials" 
          element={
            <ProtectedRoute>
              <AzureCredentials />
            </ProtectedRoute>
          } 
        />
        <Route path="/" element={<Navigate to="/dashboard" />} />
      </Routes>
    </Router>
  );
}

export default App;
